thank you @lavaa personally.', 'Is there a way to do this with the default rendering? I switch the pipeline and my game turns pink. :(', 'Fine', 'just saying, make sure to concentrate when typing in "Min = float.MaxValue;" and "Max = float.MinValue;" because I did: "Max = float.MaxValue;" and "Min = float.MinValue;". and because I did that, the colors didn't work. I don't think a lot of you will have this problem, but just in case...', '6:55 theres no blackboard on the left', 'Ran into an issue with only one color on the whole planet, my mistake was in the end of ShapeGenerator.cs

Error:
        elevation = (1+elevation);
        elevationMinMax.AddValue(elevation);
        return pointOnUnitSphere * settings.planetRadius * elevation;

Correct:
        elevation = settings.planetRadius * (1+elevation);
        elevationMinMax.AddValue(elevation);
        return pointOnUnitSphere * elevation;

Hope this helps someone :)', 'For those of you struggling with a black/white planet without gradient:
On Shader graph click on graph inspector and click on the inputs in the graph: you will see a Reference property, initialized with some random stuff... change to the name of the parameter, save, generate planet and done!', 'Attention 2020s people! Unity has changed a bit since this video came out, so I will try to walk you guys through how I got it working in a modern version like 2021.3.3f1. I'll list out the differences:

Step 1: When he tells you to look for the lightweight render pipeline in the package manager, you have to look for "Universal RP" instead and download that.

Step 2: When he says to create a "lightweight pipeline asset," you need to instead go Create > Rendering > URP Asset (with Universal Renderer). When you rename it, it creates two assets. That's what's supposed to happen. The one on the left should be the one that you drag into the settings in the next step.

Step 3: Go to Edit > Project Settings like he says in the video. Click on graphics. The first thing you see on the right should say "Scriptable Render Pipeline Settings." This is a field where you can drag your URP asset or select it from the dropdown menu.

Step 4: For creating your planet shader, go Create > Shader Graph > URP > Lit Shader Graph.

Step 5: When he's editing the shader in the video, you'll notice that the "master node" looks different. When following his steps, whenever he drags a connection to his "Albedo" property. You instead need to drag your connection to the "Base Color" property in the "Fragment" node.

That's about it, I think. Every other step in the video still works for me. I hope this helps.', 'First of all a big thank you to Sebastian for this great tutorial series.. and a big ... not so nice few words to unity. Is it just me or is Unity getting less compatible with each version? I know 4 years are a long time but something as simple as the rendering pipeline should, at the very least, keep a few names throughout a few years. Looks like the same thing was done over and over and over and over and over and over and over and over and over and over and over and over and over and over and over again by unity just to increase complexeity without adding anything worthwhile.

Sorry for the rant. But i have seen this since the first versions of unity and it just sets me up that this is the only thing that unity keeps doing steadily through its development... changing things with the goal of making it more complicated rather than allowing legacy controls to stay...', 'This is absolutely incredible, thanks for this video series!']

