['NullReferenceException: Object reference not set to an instance of an object
Guard.CanSeePlayer () (at Assets/Scripts/Guard.cs:48)
Guard.Update () (at Assets/Scripts/Guard.cs:37)
How to get rid of this error ?', 'Hello, wonderful series of videos I must say. Now regarding the first part of this video, I end up having a nice character move just by using the Rotate function associated with horizontal input. Any advantages of using Sebastian method instead?', 'So I accepted the controller challenge, tried implementing my own version of player controller, then put on par with your implementation and adjust mine a lil' bit, I figured out 1 thing: Your controller version has a buggy movement compared to mine.
When your character moves in a direction then turns abruptly, like pressing A (left) then press D or W S, your character will move FORWARD a bit, relative to itself. I think this happens due to the smoothInputMagnitude, it makes the character turn smoothly but don't turn within its position. Why does this matter? Remember when you have to normalize input so that your character won't move faster when going diagonally? This problem is pretty similar to it, you can press 2 keys continuously as long as they're different (like A-D, W-S, A-S) to make your character move faster than moving normally by holding key(s). It's a room for exploit.
Here's my implementation version, my version makes my character turn in its place so no buggy movement, just wiggling. I did applied Seb's LerpAngle into mine, it makes my character turn smoothly (than before). So I think the best answer here is to remove the Mathf.SmoothDamp() function, that will remove the buggy movement, to my knowledge, I'm still a beginner though. 
EDIT: I found the reason, it's actually due to velocity = transform.forward * moveSpeed * smoothInputMagnitude. When I changed transform.forward into inputDirection, the buggy movement is gone. But it turns out my character has the buggy movement when it moves faster diagonally compared to Seb's when I used the technique aforementioned, lol. Then I tried applying the Mathf.SmoothDamp() function, so now 2 characters move identical, smoothly and no buggy movement. Damn.
By the way, thank you Seb, I've been following your tutorials and I must say they're fantastic, the explanation is clear, the knowledge is vast, I've learned a lot. I hope you would make more insightful tutorials like these in the future. In the mean time, cheers!

