public class Part10b : MonoBehaviour
{
    bool isMoving = false;

    void Update()
    {
        if (isMoving == false)
        {
            if(Input.GetKeyDown (KeyCode.Space))
            {
                isMoving = true;
                StartCoroutine(Move(Random.onUnitSphere * 5, 8));
            }
