['After this tutorial the Seeker started to go through unwalkable areas. Any ideas why?', "I had a weird bug. When selecting the corners, it wouldn't always go towards another Node. 
Turns out it had difficulty because of the round up in the NodeFromWorldPoint. (Like x=14.32 would be rounded to 14) .

Here was my solution (my NodeFromWorldPoint function) for people in the future: 

public Node NodeFromWorldPoint(Vector3 worldPosition){

        float percentPosition(float _worldPosition, float gridWorldSize) => (_worldPosition + gridWorldSize / 2)/ gridWorldSize;

        int coordinate(float gridSize, float percent) => Mathf.RoundToInt((gridSize - 1) * percent);

        //Gets it the position is positive or negative
        float xSign = Mathf.Abs(worldPosition.x) / worldPosition.x;
        float zSign = Mathf.Abs(worldPosition.z) / worldPosition.z;

        //Converts the worldposition that would be equivalent to the center of a node
        float posX = (int)worldPosition.x + (NodeRadius / xSign);
        float posZ = (int)worldPosition.z + (NodeRadius / zSign);

        float percentX = percentPosition(posX, GridWorldSize.x);
        float percentY = percentPosition(posZ, GridWorldSize.y);

        percentX = Mathf.Clamp01(percentX);
        percentY = Mathf.Clamp01(percentY);

        int x = coordinate(GridSizeX, percentX);
        int y = coordinate(GridSizeY, percentY);

        return Grid[x,y];
    }", 'Thank you so much for this! Great explanations! What if I want my agents to always use their right-hand side of the path? Like in traffic for example?', 'You could also use catmull rom splines!', 'just to clarify, the use of term boundaries here is really to minimize the use of square roots? to not have to use vector.distance()? i dont get why its used otherwise', "Has anybody tried to visualize the path before seeker starts its movement? Something like smooth line. I'm using bezier curve for that. But it works perfect only when there are only 2-3 lookpoints", 'How can I make the grid work for 3d scenes with more than 1 floor that can have multiple connections between floors?', 'Hey champ,
firstly, you are a champ, and secondly, which video do you explain the mathematics behind that line of code from the GetSide() ? :D', 'Hello, I would like the player to be able to add objects on the map which are unwalkable as well. I am struggling to modify the code so when I place a new object to the map the unit to recalculate the path. Is it possible if you help me?', "One think that I still don't understand (maybe I just missed the episode with the code?) is your A* implementation doesn't reset the cost values of the nodes and it still works. Usually when you read about the A* implementation the first thing they do is to initialize the cost values of every node before the actual path search loop starts, but your implementation doesn't do that, in the first run they will have the default values, but for every following call they will have the previous cost values, because you never reset them, yet it still works. Am I missing something?"]

['How do I download the textures? When I click download, nothing happens.', 'So no normal map and spec map support?  Thats a shame.', '(*/œâÔºº*)', 'Thanks  Again as always my mind is blown by how smart you are.          o(*Ôø£‚ñΩÔø£*)„Éñ', "I have a doubt from the start of the 3d mesh generation, your mountains have little bumps in it, but mine don't, how to fix it?", "Hello everyone, I just merged a curved world shader (for a planet-like effect) I found from the internet with Sebastian's custom shader but the far sides of the map is just water. The shader first bends the vertex and then applies the textures. I am a complete beginner in shaders, is there a way to reverse that?", "Can i write something in my shader to achieve point filtering? I want textures that aren't blurry when scaled, just more pixelated. When i apply point filtering(no filter) in the texture settings, there's no difference when i scale in the Default texture (texture data)... i want to achieve a look similar to what Valheim has :)", 'I tried adding in a desert to the terrain by passing in a vector 3 to represent the center of the desert area by passing it in as 3 separate floats, then taking subtracting the position of the desert from the IN.worldPos x and z. but instead of getting a circular area, I end up with a large with bar spanning the length or width of the terrain. not sure where I am going wrong', 'I took the implentation of the shader used in the Hydraulic Erosion video and combined it with the tri-planar texture mapping method in this tutorial. now I have an angle blended shader, with textures.', 'URP working shader (2021.2.14f current version of Unity).

Shader "SLE/MapGeneration/Terrain" 
{

	Properties
	{
		_Color("Color", Color) = (1,1,1,1)
	}
	
	SubShader
	{
		Tags 
		{ 
			"RenderPipeline" = "UniversalPipeline" 
			"RenderType" = "Opaque"
		    "Queue" = "Geometry"
		}
		LOD 200

		Pass
		{
			Name "Universal Forward"
			Tags 
			{ 
				"LightMode" = "UniversalForward" 
			}

			Cull Back
			Blend One Zero
			ZTest LEqual
			ZWrite On

			HLSLPROGRAM

			#pragma target 4.5
			#pragma exclude_renderers gles gles3
			#pragma multi_compile_instancing
			#pragma multi_compile_fog
			#pragma instancing_options renderinglayer
			#pragma multi_compile _ DOTS_INSTANCING_ON
			#pragma vertex vert
			#pragma fragment frag

			#include "Packages/com.unity.render-pipelines.universal/ShaderLibrary/Lighting.hlsl"
			#include "Packages/com.unity.render-pipelines.universal/ShaderLibrary/Core.hlsl"

			const static int   maxLayerCount = 8;
			const static float epsilon = 1e-4;

			CBUFFER_START(UnityPerMaterial)

			int    layerCount;
			float3 baseColors[maxLayerCount];
			float  baseStartHeights[maxLayerCount];
			float  baseBlends[maxLayerCount];
			float  baseColorStrength[maxLayerCount];
			float  baseTextureScales[maxLayerCount];

			float minHeight;
			float maxHeight;

			CBUFFER_END

			TEXTURE2D_ARRAY(baseTextures);
			SAMPLER(sampler_baseTextures);

			struct v2f
			{
				float4 vertex     : SV_POSITION;
				float3 worldPos   : TEXCOORD0;
				half3 worldNormal : TEXCOORD1;
				half4 diff        : COLOR0; // diffuse lighting color
				half3 ambient     : COLOR1;
			};

			float inverseLerp(float a, float b, float value) 
			{
				return saturate((value - a) / (b - a));
			}

			float3 triplanar(float3 worldPos, float scale, float3 blendAxes, int textureIndex) 
			{
				float3 scaledWorldPos = worldPos / scale;
				
				float3 xProjection = SAMPLE_TEXTURE2D_ARRAY(baseTextures, sampler_baseTextures, float2(scaledWorldPos.y, scaledWorldPos.z), textureIndex) * blendAxes.x;
				float3 yProjection = SAMPLE_TEXTURE2D_ARRAY(baseTextures, sampler_baseTextures, float2(scaledWorldPos.x, scaledWorldPos.z), textureIndex) * blendAxes.y;
				float3 zProjection = SAMPLE_TEXTURE2D_ARRAY(baseTextures, sampler_baseTextures, float2(scaledWorldPos.x, scaledWorldPos.y), textureIndex) * blendAxes.z;
				
				return xProjection + yProjection + zProjection;
			}

			v2f vert(float4 vertex : POSITION, float3 normal : NORMAL)
			{
				v2f o;

				o.worldPos    = mul(unity_ObjectToWorld, vertex);
				o.vertex      = TransformObjectToHClip(vertex);
				o.worldNormal = TransformObjectToWorldNormal(normal);

				Light mainLight = GetMainLight();

				half nl = max(0, dot(o.worldNormal, mainLight.direction.xyz));
				
				// factor in the light color
				o.diff = nl * half4(mainLight.color, 1);
				
				o.ambient = SampleSH(o.worldNormal);
				
				TransformWorldToShadowCoord(vertex.xyz);
				
				return o;
			}

			half4 _Color;
			half4 frag(v2f IN) : SV_Target
			{
				float heightPercent = inverseLerp(minHeight, maxHeight, IN.worldPos.y);
				float3 blendAxes    = abs(IN.worldNormal);
				
				blendAxes /= blendAxes.x + blendAxes.y + blendAxes.z;

				half3 col = _Color;
				for (int i = 0; i < layerCount; i++) 
				{
					float a = -baseBlends[i] / 2.0 - epsilon;
					float b = baseBlends[i] / 2.0;
					float t = heightPercent - baseStartHeights[i];

					float drawStrength = inverseLerp(a, b, t);

					float3 baseColor    = baseColors[i] * baseColorStrength[i];
					float3 textureColor = triplanar(IN.worldPos, baseTextureScales[i], blendAxes, i) * (1 - baseColorStrength[i]);

					col = col * (1 - drawStrength) + (baseColor + textureColor) * drawStrength;
				}
				_Color.rgb = col;

				Light mainLight = GetMainLight();

				// darken light's illumination with shadow, keep ambient intact
				half3 lighting = IN.diff * mainLight.shadowAttenuation + IN.ambient;
				_Color.rgb *= lighting;

				return _Color;
			}

			ENDHLSL
		}
	}
}']

