I don‚Äôt know why in Sebastian‚Äôs case that its already working right away without declaring it first, but yeah. Hope this helps a few people.', 'I have updated the shader to work on HLSL, instead of CG, kinda, and now I am  able to, finally, get textures working in URP, instad of having a full purple/pink color. :D
It took me like a week.', "I'm proud I am the 999th person to like this video", "For those getting a black texture there are many comments here showing how to fix it. I'd recommend following @Siege107 's solution first. @Gamingturtle The First also recommends a simple fix that some of you (like me) missed in the last video. Be sure to have this in your OnValidate method:

