['For people that have seams in terrain. When you generate mapdata (noisemap especially) and during mesh generation you should always keep track of biggest factor (LOD simplification number) and current factor. When creating noise map for chunks generate them for size of chunk + size of border with birder thickness being the biggest factor. Then during mesh generator you dont make the border be of size one, but of size equal to current factor (still one thickness, just sampling from the offset equal to currently used factor). Because noisemap is made for highest factor possible, you will never get out of bounds error. With this method you can skip his later chapter on the kinda hacky high res border and it will look much better.

P.S I strongly recommend reading up on job systems / burstcompiler and entire ecs. Some of the code in this tutorial can be sped up by 20x easily using jobs, you can also replace manually declared threads with jobs making code way easier to read.', "I've been having a problem for a few episodes now that the central 9 chunks don't load on play. when I move the viewer around and back, they are fine. When I check the terrain chunks, I can see they are missing the mesh's. Is there any fix for this other then some crude method of loading the map and the moving the player?", "I've been following along with this tutorial and it's been very helpful so far! However something I've noticed after making the changes for the normals and border size is that the map generator no longer seems to draw the chunks closest to the player, but draws the outer ring of chunks.

