Also for some reason using the fall-off map now just causes there to be a weird lip where the water increased in height and was wondering if anyone had a fix for this?

Edit: I found that it wasn't the changes with the bordered size and mesh size that caused this, but was an oversight with the collisions, I'll need to revisit the collisions episode, however if anyone has a solution for the falloff map acting weird it would be greatly appreciated!", 'The solution to make Fallout map work is -> In MapGenerator class. Change every "falloffMap = FalloffGenerator.GenerateFalloffMap(mapChunkSize);"" into 	falloffMap = FalloffGenerator.GenerateFalloffMap(mapChunkSize +2);

After that you change the first two loops of "MapData GenerateMapData" in same classs. Make them look like this. ( I just added +2)

	 for (int y = 0; y < mapChunkSize+2; y++){
		 for (int x = 0; x < mapChunkSize+2; x++){
			 if(useFalloff){', 'When I start the game the textures seem to disppear from the screen and the whole mesh becomes a gray colour. i have followed the instructions step by step and i dont think it has something to do with my code.', "Hey, I downloaded the latest sourcecode and tried it out but It seems at some point along the line the falloff map feature to create like and Island got dropped. the useFallOff setting in the hieghtmap is never used. I started your tutorial series awhile back and got through to episode 12 but then I hadn't come back to it for awhile. I figured I'd jump to the end and see if I can get it working for what I want to build but I guess not. Let me know if I'm missing something, otherwise I'll see if I can pickup where I left off in the series and figure out where the fallOffmap  feature died.", "You've made the hard work! we're just following and trying to understand all of it. All considered thanks mate! Cheers!", 'Old but gold', 'Running across this problem 5 years later, I solved this a slightly easier way by creating mesh data 2 units larger on each axis to include the edge of the next chunk.  I store the triangles in 2 lists, one for triangles without the edges and one with them included.  When creating the actual mesh, you can call RecalculateNormals() on the larger mesh then replace the mesh.triangles array with the smaller one.  It seems quite performant and the only downside is you are left with some orphaned vertices at the edges of the mesh but those could be removed quite easily with the same method.', 'I ran into an issue with the normals. with an angle blended shader, the normals are not being calculated right anymore and textuers that should appear on steep surfaces are not appearing at all, IE, grass and dirt and other surface materials on flatter surfaces and rock face materials and such on steep surfaces such as cliff faces and mountain sides']

