["If you're having trouble falling off a of slopes and have tried everything else, in your ClimbSlope() method, don't change velocity.y when velocity.x is zero.
What's happening is that when you sit still on a slope, your climb slope method is making your velocity.y = 0 so you can rays upwards.
When you start moving, you have no negative velocity, so you aren't counted as descending the slope, so you fall off of it.
simply add if(velocity.x != 0){velocity.y = climbVelocityY;} instead of always setting velocity.y = climbVelocityY;", '"if (hit.distance - skinWidth <= Mathf.Tan(slopeAngle * Mathf.Deg2Rad) * Mathf.Abs(velocity.x))" 
seems to not always work causing player to fly off the slopes. U can try changing the value, for example: "skinWidth*2".', 'ÍµêÏàòÎãò Ï†ïÎßê Í∞êÏÇ¨Ìï©ÎãàÎã§ ÏÇ¨ÎûëÌï¥Ïöî Îï°ÌÅê !!', 'Sebastian or any one why the correction ,show at the begining of the video, was coded in the VerticalCollisions method and not in the HorizontalCollisions?', 'To anyone with a problem of falling off when going down slopes, try turning vsync on, it worked after i turned it on', 'Thank you very much for this series!', "The fix code seems to me unnecessarily making things complex. Isn't there any other better way?", 'Question: Are we supposed to be able to jump while descending slopes? I am finding difficulty here.', 'How are you declaring rayOrigin and hit again as they are already declared locally in the VerticalCollisions?', 'If your player is getting stuck moving from a steeper slope to a more shallow slope or moving down a slope onto flat ground it is likely that the descend slope function moves them into the ground. To fix this, I cast a new ray from the other bottom corner to the ground to give me the maximum distance the player could move without clipping into the ground. The descending y value is then clamped to this value. This solution is not perfect as if the player is moving fast enough that the corner will legitimately try to move further down the slope than the clamped distance, however, it is an edge case not worth worrying about.

Code provided as a reference

    void DescendSlope(ref Vector3 velocity){
        float directionX = Mathf.Sign(velocity.x);
        Vector2 rayOrigin = (directionX == -1)?raycastOrigins.bottomRight:raycastOrigins.bottomLeft;
        RaycastHit2D hit = Physics2D.Raycast(rayOrigin, -Vector2.up,Mathf.Infinity,collisionMask);
        if (hit){
            float slopeAngle = Vector2.Angle(hit.normal,Vector2.up);

            if (slopeAngle != 0 && slopeAngle <= maxDescendAngle){
                if (Mathf.Sign(hit.normal.x) == directionX){
                    if (hit.distance-skinWidth <= Mathf.Tan(slopeAngle*Mathf.Deg2Rad) * Mathf.Abs(velocity.x)){
                        float moveDistance = Mathf.Abs(velocity.x);

                        //Custom fix
                        Vector2 oppositeSideRayOrigin = (directionX == -1)?raycastOrigins.bottomLeft:raycastOrigins.bottomRight;
                        RaycastHit2D oppositeSideHit = Physics2D.Raycast(oppositeSideRayOrigin, -Vector2.up,Mathf.Infinity,collisionMask);
                        float descendVelocityY = Mathf.Clamp( Mathf.Sin(slopeAngle * Mathf.Deg2Rad)* moveDistance,-Mathf.Infinity,oppositeSideHit.distance-skinWidth);
                        //
                        
                        velocity.x = Mathf.Cos(slopeAngle * Mathf.Deg2Rad)* moveDistance*Mathf.Sign(velocity.x);
                        velocity.y -= descendVelocityY;
                        collisions.slopeAngle = slopeAngle;
                        collisions.below = true;
                        collisions.descendingSlope = true;
                    }
                }
            }
        }
    }']

